export default <style>{`
  body {
      margin:50px 400px;
      paddins:5px;
      color:#669
  }
  　g_navi ul {
	overflow: hidden;
	margin: 0 auto;
	padding: 0 3%;
	width: 94%;
	max-width: 960px; 
}
	g_navi ul li {
		position: relative;
		float: left;
		width: 20%;
	}
		g_navi ul li a {
	 		display: block;
			padding: 17px 5%;
			width: 90%;
			color: #fff;
			text-align: center;
			text-decoration: none;
		}
  footer {
      color:#99c;
      font-size:12pt;
      text-align:right;
      border-bottom:1px solid #99c;
      margin:50px 0px 10px 0px;
      position: relative;
      bottom: 10px;
      right: 10px;
      left: 10px;
  }
  h1 {
      font-size:22pt;
      font-weight:bold;
      text-align:left;
      letter-spacing:0px;
      color:#77a;
      margin:-50px 0px 50px 0px;
  }
  p {
      margin:0px;
      color:#669;
      font-size:12pt;
  }
  hr {
      margin:25px 0px;
  }
  tr {
      margin:0px;
  }
  th {
      font-size:14pt;
      font-weight:plain;
      text-align:left;
      padding:0px 20px;
      margin:0px;
      border-botton:1px solid gray;
  }
`} </style>
